    $("#contenedorForm").on('click', '.btn-editarPedido', function(e) {
        e.preventDefault();
        console.log('estoy editando el producto');
        var ultimoRegistro = count;
        var id_registro = $(this).attr("id"); //obtengo el id del registro a editar
        var longitud_id = id_registro.length; //obtengo la longitud del id para sacar el ultimo caracter
        var numRegistro = id_registro.charAt(longitud_id - 1); //obtengo el ultimo caracter que es el numero del registro
        nRegistrov = parseInt(numRegistro); //convertimos el string a entero para asignarselos a los inputs que se editaran
        if (numRegistro === "0" || numRegistro === "") {
            console.log('------------no hay nada que editar');
        } else {
            if (count > 0) {
                if (nRegistrov !== ultimoRegistro) {
                    $('#cantidadUp').val($('#cantidad_' + nRegistrov).val());
                    $('#descripcionUp').val($('#descripcion_' + nRegistrov).val());
                    $('#modeloUp').val($('#modelo_' + nRegistrov).val());
                    $('#precioUp').val($('#precio_' + nRegistrov).val());
                    $('#anticipoUp').val($('#anticipo_' + nRegistrov).val());

                    $('#editarPedido').modal({
                        show: true
                    });
                } else {
                    console.log('es el ultimo registro no podemos editarlo');
                }
            } else {
                console.log('no hay registros aun para editar');
            }
        }
    });
